import React, { useState, useEffect } from "react";

const Graph = () => {
  const [profits, setProfits] = useState([]);

  useEffect(() => {
    fetch("http://localhost:8000/profits")
      .then((response) => response.json())
      .then((data) => setProfits(data))
      .catch((error) => console.error("Error fetching data:", error));
  }, []);

  const renderBars = () => {
    return Object.entries(profits).map(([period, profit]) => (
      <div key={period} className="bar" style={{ height: `${profit}px` }}>
        <div className="label">{period}</div>
      </div>
    ));
  };

  return (
    <div>
      <h1>Profits Graph</h1>
      <div className="chart">{profits && renderBars()}</div>
    </div>
  );
};

export default Graph;
